import i18next from "i18next";
import { initReactI18next } from "react-i18next";

i18next.use(initReactI18next).init({
  resources: {
    en: {
      Services: "Services",
      Strategy: "Strategy",
      CasesandClients: "Cases&Clients",
      AboutUs: "About Us",
      ContactandSupport: "Contact and Support",
      Yourdeliveredexpectationsatjustoneclickaway:
        "Your delivered expectations at just one click away",
    },

    da: {
      translation: {
        Services: "Tjenester",
        Strategy: "Strategi",
        CasesandClients: "Sager og Klienter",
        AboutUs: "Om os",
        ContactandSupport: "Kontakt og Support",
        Yourdeliveredexpectationsatjustoneclickaway:
          "Dine leverede forventninger med kun et klik væk",
      },
    },
  },

  //   default language
  lang: "en",
});

export default i18next;
